<script>
    // Event listener for "Mulai" button click
    var mulaiButton = document.getElementById("mulaiButton");
    if (mulaiButton) {
        mulaiButton.addEventListener("click", function(e) {
            showBubbleQuestion();
        });
    }

    // Function to show the bubble question
    function showBubbleQuestion() {
        var bubbleQuestion = document.getElementById("bubbleQuestion");
        bubbleQuestion.style.display = "block";
    }

    // Function to handle form submission
    function submitForm() {
        // event.preventDefault(); // Prevent default form submission

        // Get the form element
        var form = document.getElementById("bubbleForm");

        // Perform form submission or other actions
        console.log("Form submitted!");
        console.log("Rating: " + getSelectedRating());
        // console.log("Kritik dan Saran: " + form.kritikSaran.value);

        // Reset form values
        form.reset();

        // Hide the bubble question
        var bubbleQuestion = document.getElementById("bubbleQuestion");
        bubbleQuestion.style.display = "none";

        var rating = document.getElementById('rating');
        var gedung = document.getElementById('gedung');
        var kritiksaran = document.getElementById('kritiksaran');
        saran = $('#saran').val();
        alert(saran);
        // $.ajax({
        //     url: '<?= base_url('user/tambah_respon2') ?>',
        //     type: 'POST',
        //     data: {
        //         id: <?= $id['id'] ?>,
        //         rating: rating.value,
        //         gedung: gedung.value,
        //         kritik: kritiksaran.value,
        //     },
        //     success: function(result){
        //         alert(result);
        //     }
        // })

        // Show thank you message or perform other actions
        showThankYouPopup();
    }

    // Function to show the thank you popup
    function showThankYouPopup() {
        // Tambahkan kode untuk menampilkan popup terima kasih
        console.log("Terima kasih!");

        // Reset warna bintang menjadi putih
        var stars = document.getElementsByClassName("fas fa-star ");
        for (var i = 0; i < stars.length; i++) {
            stars[i].classList.remove("yellow-star");
        }
    }

    function sendRating(rating) {
        // Kirim rating ke server atau lakukan tindakan lain
        console.log("Rating: " + rating);
        // alert(rating);

        // Ubah warna ikon menjadi kuning
        var stars = document.getElementsByClassName("fas fa-star");
        for (var i = 0; i < stars.length; i++) {
            if (i < rating) {
                stars[i].classList.add("yellow-star");
            } else {
                stars[i].classList.remove("yellow-star");
            }
        }
        var bintang = document.getElementById('rating');
        bintang.value = rating
    }

    // Function to get the selected rating
    function getSelectedRating() {
        var stars = document.getElementsByClassName("fas fa-star yellow-star");
        return stars.length;
    }
</script>
